import {Navbar , Nav ,Form, FormControl , Button} from 'react-bootstrap';

const Header =  ()  => {
    return (
      <Navbar
        variant="light"
        fixed="True"
        style={{
          border: "3px solid white",
          padding: "8px",
          margin: "2px",
          borderRadius: "10px",
          backgroundColor: "#ebebf5",
          marginTop: "0px",
          boxShadow: "0px 3px 8px #9f9fa6"
        }}
      >
        <Navbar.Brand href="#home" style={{ padding: "2px", displa }}>
          <img src={process.env.PUBLIC_URL + "/code.jpg"} width="30px" heigth="30px" padding="5px"/>
          <div style={{PaddingLeft:"1px"}}>
          CMJUDGE
          </div>
        </Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">Assignments</Nav.Link>
          <Nav.Link href="#pricing">Profile</Nav.Link>
        </Nav>

        <Form inline>
          {/* <FormControl type="text" placeholder="Search" className="mr-sm-2" /> */}
          <Button variant="outline-info">Sign Out</Button>
        </Form>
      </Navbar>
    );  
};

export default Header;
